import React from 'react';
import styles from './SummaryBox.module.scss';

const SummaryBox = (props: { label: any; value: any; iconType: any; }) => {
  const { label, value, iconType } = props;

  const renderIcon = (type: any) => {
    switch (type) {
      case 'RevenueIcon':
        return <RevenueIcon />;
      case 'CashBackIcon':
        return <CashBackIcon />;
      case 'ScaleIcon':
        return <ScaleIcon />;
      case 'ClickIcon':
        return <ClickIcon />;
      case 'TrafficIcon':
        return <TrafficIcon />;
      case 'PurchaseIcon':
        return <PurchaseIcon />;
      default:
        return <></>;
    }
  };
  return (
    <div className={styles.s_box}>
      <div className={styles.revenue_icon}>
        {renderIcon(iconType)}
      </div>
      <div className={styles.label}>
        {label}
      </div>
      <div className={styles.value}>
        {value}
      </div>
    </div>
  // <label className="label-text" {...props}>
  //   {children}
  //   {required && <span className="asterik">*</span>}
  // </label>
  );
};

